include 'include/ez80.inc'
include 'include/ti84pceg.inc'
include 'include/tiformat.inc'
format ti executable 'ZCONSBAK'
include 'include/app.inc'

; ------------------------------------------------
; this table holds the list of functions to export
; to the basic library. Order matters.

	export InstallAACONSOL
	export InstallCLibs

; ------------------------------------------------
; create application
; returns nz if could not create the application
; i.e. already installed
	app_create
	
	;ret	nz
	ret
	;call	ti.ChkFindSym
	;jp	ti.DelVarArc		; delete installer code

; ------------------------------------------------
; start of actual application code
	app_start 'ZCONSBAK', '(C) 2021 jollyroger182', '1.0.0.3', 3
	
	call	ti.ClrScrnFull
	call	ti.HomeUp
	ld	hl,_str1
	call	ti.PutS
	call	ti.NewLine
	ld	hl,_str2
	call	ti.PutS
_loop:
	call	ti.os.GetCSC
	or	a,a
	jp	z,_loop
	jp	ti.JForceCmdNoChar

_str1:
	db	"1:Install AACONSOL",0
_str2:
	db	"2:Install CLibs",0

InstallAACONSOL:
	ld	hl,_aaconsol_name
	call	ti.Mov9ToOP1
	call	ti.ChkFindSym
	jp	c,_install_aacon
	call	ti.DelVarArc
_install_aacon:
	ld	hl,_aaconsol_name
	call	ti.Mov9ToOP1
	ld	hl,36524
	call	ti.CreateProtProg

	ld	hl,_aaconsol
	ld	bc,36524
	inc	de
	inc	de
	ldir
	ld	hl,_aaconsol_name
	call	ti.Mov9ToOP1
	call	ti.Arc_Unarc
	jp InstallCLibs

_aaconsol_name:
	db	ti.ProtProgObj,"AACONSOL"
